script: |
  super -f text -I q10745.spq | sort > q10745.out

inputs:
  - name: q10745.spq
    data: |
      SELECT + + 64 * - 9 * + + 88 * - - 17 * + 29 AS col0 FROM tab2 (FORMAT parquet) WHERE NULL BETWEEN - col1 * - col2 AND + col1 * + col2;
  - name: tab2

outputs:
  - name: q10745.out
    data: |
